import React from "react";

function Tabs({ title, page }) {
  return (
    <div className={`tabs ${page === title ? "tab_border" : ""}`}>{title}</div>
  );
}
export default function HomeLeft({ page }) {
  return (
    <div className="home_left">
      <Tabs title="Feed" page={page} />
      <Tabs title="Chat" />
    </div>
  );
}
